import React from 'react'
import '../footer/Footer.scss';
import { CButton } from '@coreui/react';
import 'bootstrap/dist/css/bootstrap.min.css'
import facebook from '../images/icon-facebook.svg'
import twitter from '../images/icon-twitter.svg'
import pinterest from '../images/icon-pinterest.svg'
import instagram from '../images/icon-instagram.svg'
class footer2 extends React.Component {
    render() {
        return (
            <div className="footer2">
                <div className="foot-content">
                    <CButton className='Shortly' color="secondary" variant="ghost">Shortly</CButton>
                    <div className="buttons">
                        <CButton className='Near-shortly' color="secondary" variant="ghost">Features</CButton>
                        <CButton className='Near-shortly' color="secondary" variant="ghost">Pricing</CButton>
                        <CButton className='Near-shortly' color="secondary" variant="ghost">Resources</CButton>
                    </div>
                    <div className="social-icons">

                    </div>
                </div>
            </div>
        )
    }
}

export default footer2;
